import * as React from 'react';
import Button from '@mui/material/Button';
import { Box } from '@mui/material';





function Settings() {

  return (
    <Box >
    <Button variant="contained" disableElevation sx={{ml:130 }} style={{backgroundColor:"orange" , color:"white"}}>
      أضف حصة
    </Button>

    </Box>
  )
}

export default Settings
